import React from 'react';

const Exercicio2 = ({ posts }) => {
  return (
    <div>
      {posts.map((item, index) => (
        <div key={index}>
          <li>{item.title}</li>
          <li>{item.content}</li>
        </div>
      ))}
    </div>
  );
};  

export default Exercicio2;
